  "HEALTH_DATA_PREVIEW_INTRO": "<p>{APP_NAME} <strong>เดตเตเดฏเดเตเดคเดฟเดชเดฐเดฎเดพเดฏเดฟ เดคเดฟเดฐเดฟเดเตเดเดฑเดฟเดฏเดพเตป เดเดดเดฟเดฏเตเดจเตเดจ เดฏเดพเดคเตเดฐเต เดตเดฟเดตเดฐเดตเตเด เดถเตเดเดฐเดฟเดเตเดเตเดเดฏเต เดชเตเดฐเตเดธเดธเตเดธเต เดเตเดฏเตเดฏเตเดเดฏเต เดเตเดฏเตเดฏเตเดจเตเดจเดฟเดฒเตเดฒ</strong>, เดเดจเตเดจเดพเตฝ เดจเดฟเดเตเดเดณเตเดเต เดธเตเดตเดเดพเดฐเตเดฏเดค เดธเดเดฐเดเตเดทเดฟเดเตเดเตเดจเตเดจเดคเดฟเดจเต <strong>เดเดเตเดเดพเดค เดเดชเดฏเตเด เดธเตเดฅเดฟเดคเดฟเดตเดฟเดตเดฐเดเตเดเดฃเดเตเดเตเดเตพ เดถเตเดเดฐเดฟเดเตเดเตเดจเตเดจเต</strong>. เด <strong>เดเดเตเดเดพเดค</strong> เดเดชเตเดชเต เดเดชเดฏเตเด เดธเตเดฅเดฟเดคเดฟเดตเดฟเดตเดฐเดเตเดเดฃเดเตเดเตเดเดณเตเด เดชเดฟเดถเดเต เดฑเดฟเดชเตเดชเตเตผเดเตเดเตเดเดณเตเด {APP_NAME} เดเดชเดฏเตเดเดฟเดเตเดเตเดณเตเดณ เดจเดฟเดเตเดเดณเตเดเต เดเดจเตเดญเดตเด เดฎเตเดเตเดเดชเตเดชเตเดเตเดคเตเดคเตเดจเตเดจเดคเดฟเดจเต เดธเดตเดฟเดถเตเดทเดคเดเตพเดเตเดเต เดฎเตเตปเดเดฃเดจ เดจเตฝเดเดพเดจเตเด เดฌเดเตเดเตพ เดเดฃเตเดเตเดคเตเดคเดพเดจเตเด เดเดชเดฏเตเดเดเตเดทเดฎเดค เดชเตเดฐเดถเตเดจเดเตเดเตพ เดเดฃเตเดเตเดคเตเดคเดพเดจเตเด เดธเดนเดพเดฏเดฟเดเตเดเตเดจเตเดจเต.</p> <p>เดจเดฟเดเตเดเดณเตเดเต เดเดเตเดคเตเดค เดเดฐเตเดเตเดฏ เดฑเดฟเดชเตเดชเตเตผเดเตเดเดฟเตฝ เดเดคเต เดชเตเดฐเดตเตผเดคเตเดคเดจเดเตเดทเดฎเดฎเดพเดเตเดเดฟเดฏเดฟเดเตเดเตเดฃเตเดเตเดเตเดเดฟเตฝ <em>เดเดฏเดฏเตโเดเตเดเตเดจเตเดจ</em> เดกเดพเดฑเตเดฑเดฏเตเดเต เดเดฐเต เดชเตเดฐเดฟเดตเตเดฏเต เดเตเดตเดเตเดฏเตเดฃเตเดเต. ('Caught Critical error' เดเดจเตเดจเต เดเดเดฏเดพเดณเดชเตเดชเตเดเตเดคเตเดคเดฟเดฏ เดชเดฟเดถเดเต เดฒเตเดเตเดเตพเดเตเดเดพเดฏเดฟ เดกเตเดตเดฒเดชเตเดชเตผ เดเตบเดธเตเดณเตเด เดเดพเดฃเตเด.)</p>",
